import React from "react";
import { Grid } from '@material-ui/core';
import "./Landing.css";

function Menu() {
  return (
    <Grid container justify="center" className="menu-container">
        <div className="menu-navbar">
            hello
        </div>
        <ul className="menu">
            <Grid item sm={12}>
                <div className="menu-button"></div>
            </Grid>
            <Grid item sm={12}>
                <div className="menu-button"></div>
            </Grid>
            <Grid item sm={12}>
                <div className="menu-button"></div>
            </Grid>
    </ul>
    </Grid>
    
  );
}

export default Menu;
